// src/components/NavigationButton.jsx
import React from "react";
import { useNavigate } from "react-router-dom";

const NavHelper = ({ page, children }) => {
    const nav = useNavigate();
    const handleClick = () => {
        nav(page);
    };
    return (
        <button onClick={handleClick}>
            {children}
        </button>
    );
};

export default NavHelper;
